import React from 'react';

const ScoreBoard = (data) => {
    return (
        <div className="score-board">
            {/* Home Score */}
            <div className="col-sm-4 col-lg-4">
                <h4>{data.homeTeam}</h4>
                <h4 className="sb-score">{data.homeScore}</h4>
            </div>

            {/* Score Board */}
            <div className="col-sm-4 col-lg-4">
                <p>Time</p>
                <h4>{data.time}</h4>
                <p>QTR</p>
                <h4>{data.period}</h4>
            </div>

            {/* Away Score */}
            <div className="col-sm-4 col-lg-4">
                <h4>{data.awayTeam}</h4>
                <h4 className="sb-score">{data.awayTeam}</h4>
            </div>

        </div>
    )
}

export default ScoreBoard;
